import React from "react";
import type { TodoFormProps } from "../types/types";

const TodoForm: React.FC<TodoFormProps> = ({
  setTodoText,
  todoText,
  formSubmit,
}) => {
  return (
    <form
      onSubmit={(e) => {
        e.preventDefault();
        formSubmit();
      }}
      className="todo-form"
    >
      <input
        placeholder="Task"
        value={todoText}
        onChange={(e) => setTodoText(e.target.value)}
      />
      <button>Add</button>
    </form>
  );
};

export default TodoForm;
